import "./Slide.css";

 

export default function Slide(props) {
 

	const {name,image,count,id}=props.categories
	return (
		<>
			<div className="item">
				<div className="category-item">
				 
						<img
							 
							src='#'
							 alt="#"
							  
					 />
						<h6>
							 {name}
							 {
								 console.log("products categories:", )
							 }
						</h6>
						<span style={{fontWeight:'500', color:'red', fontSize:'15px'}}> {count}</span>
				 
				</div>
			</div>
		</>
	);
}
